const Ellipse4Icon2 = (props: SVGProps<SVGSVGElement>) => (
  <svg preserveAspectRatio='none' viewBox='0 0 12 12' fill='none' xmlns='http://www.w3.org/2000/svg' {...props}>
    <circle cx={6} cy={6} r={6} fill='white' stroke='#FCC43E' strokeWidth={3} />
  </svg>
);

const Memo = memo(Ellipse4Icon2);
export { Memo as Ellipse4Icon2 };
